/* This is a slot method. */
void AcceleratorAccelerator_PerformanceSlot( AcceleratorAccelerator _this, XObject 
  sender )
{
  XInt32 cpu;

  /* Dummy expressions to avoid the 'C' warning 'unused argument'. */
  EW_UNUSED_ARG( sender );

  cpu = -1;
  {
    #if EW_CPU_LOAD_MEASURING == 1
      extern int EwBspGetCpuLoad( void );

      cpu = EwBspGetCpuLoad();
    #endif
  }

  if ( CoreView__GetRoot( _this ) != 0 )
    ViewsText_OnSetString( &_this->FpsText, EwConcatString( EwNewStringInt( CoreRoot_GetFPS( 
    CoreView__GetRoot( _this )), 0, 10 ), EwLoadString( &_Const0017 )));

  if (( cpu >= 0 ) && ( cpu <= 100 ))
  {
    XColor c;
    ViewsText_OnSetString( &_this->CpuText, EwConcatString( EwNewStringInt( cpu, 
    0, 10 ), EwLoadString( &_Const0018 )));
    c = EwNewColor((XUInt8)(( cpu * 255 ) / 100 ), (XUInt8)((( 100 - cpu ) * 255 
    ) / 100 ), 0, 255 );
    ViewsText_OnSetColor( &_this->CpuText, c );
  }
  else
  {
    ViewsText_OnSetString( &_this->CpuText, EwLoadString( &_Const0019 ));
    ViewsText_OnSetColor( &_this->CpuText, _Const000B );
  }
}

/* This is a slot method. */
void AcceleratorAccelerator_NextType( AcceleratorAccelerator _this, XObject sender )
{
  /* Dummy expressions to avoid the 'C' warning 'unused argument'. */
  EW_UNUSED_ARG( sender );

  switch ( _this->GraphicsFactory.TypeOfItems )
  {
    case AcceleratorGraphicsTypeRectCopy :
      AcceleratorAccelerator_ChangeType( _this, AcceleratorGraphicsTypeBmpCopy );
    break;

    case AcceleratorGraphicsTypeBmpCopy :
      AcceleratorAccelerator_ChangeType( _this, AcceleratorGraphicsTypeRectBlend 
      );
    break;

    case AcceleratorGraphicsTypeRectBlend :
      AcceleratorAccelerator_ChangeType( _this, AcceleratorGraphicsTypeBmpBlend 
      );
    break;

    case AcceleratorGraphicsTypeBmpBlend :
      AcceleratorAccelerator_ChangeType( _this, AcceleratorGraphicsTypeAlphaBmp 
      );
    break;

    default : 
      AcceleratorAccelerator_ChangeType( _this, AcceleratorGraphicsTypeRectCopy 
      );
  }
}

